Android/prepare.html.body:
开发准备首先从北信源Linkdood官网下载 Android SDK。开发者可以根据实际需求，配置类库。类库配置SDK 包的libs文件夹中，包含了北信源Linkdood SDK的 jar 文件，各 jni 库文件夹以及 SDK 依赖的第三方库，列表如下：    libs
    ├── armeabi
    │   ├── libjniVimServicePresets.so 
    │   ├── liblddplugin.so    
    ├── armeabi-v7a
    │   ├── libjniVimServicePresets.so
    │   ├── liblddplugin.so
    └── vimsdk-version.jar
    └── javacpp.jar
以上文件列表中，imsdk-version.jar (版本号可能会不同)为Linkdood SDK，子目录中的文件是 SDK 所依赖的各个 CPU 架构的 so 库。证书下载在官网上申请生成证书，将下载好的证书命名为vimsdk.crt,保存在你项目 app/src/main/assets 下(必须)权限与组件在 AndroidManifest.xml 中加入以下配置:





// ... 你的其他权限









