2.RTCSDK音视频会话的建立2.1 两点A与B两点之间音视频会话的建立如图2所示。其中A是主叫，B是被叫。图2.两点音视频会话的建立
步骤：
1.主叫A调用RTCSDK接口CreatePeer，传入参数RTCParam，其中参    数peer_id为被叫B的ID，参数sdp为nullptr。（参数详见3.2节）
2.RTCSDK回调接口onRTCSDKMessage，其中peer_id为被叫B的ID,    消息类型type为kOffer，消息msg为生成的sdp。
3.4. 将sdp传递至被叫B。
5.被叫B调用RTCSDK接口CreatePeer，传入参数RTCParam，其中参数peer_id为主叫A的ID，参数sdp为A生成的sdp。
6.RTCSDK回调接口onRTCSDKMessage，其中peer_id为被叫A的ID，消息类型typ为kAnswer，消息msg为生成的sdp。
7.8. 将sdp传递至主叫A。
9. 主叫A调用RTCSDK接口SetRemoteDescription，其中参数peer_id为被叫B的ID，参数sdp为B生成的sdp。
10.    音视频连通，主叫和被叫的RTCSDK会通过接口onRTCSDKMessage回调kIceConnected。2.2 多点多点音视频会话的建立与两点类似。以三点的音视频会话为例，如图1(b)所示，C在A与B已经建立完成音视频会话的基础上，再分别与A和B进行两点间的音视频会话的建立。3.RTCSDK接口3.1 创建与销毁RTCSDK3.1.1 创建void createRTCSDK(RTCSDK*& p)
3.1.2 销毁void destroyRTCSDK(RTCSDK*& p)
3.2 RTCSDK参数struct RTCParam{ 
    char *ice_server; // STUN服务器地址 
    char *ice_port; // STUN服务器端口 
    char *ice_user; // STUN服务器用户名 
    char *ice_pwd; // STUN服务器密码 
    RTCCallBack *call_back; // RTCSDK回调 
    char* peer_id; // 会话对方的ID 
    char* sdp; // sdp 
    bool audio_on; // 是否打开音频 
    bool video_on; // 是否打开视频 
    HWND local; // 本地视频窗口句柄 
    HWND remote; // 对方视频窗口句柄 
    int max_bitrate; // 视频最大码率 
    int start_bitrate; // 视频起始码率 
    bool data_on; // 是否打开数据通道 
    bool ordered; // 数据包是否按顺序发送 
    int max_retransmit_time; // 数据包最大重传时间 
    int max_retransmits; // 数据包最大重传次数 
};
3.2.1 sdp主叫端在进行CreatePeer时，该指针应该为nullptr。被叫端在进行CreatePeer时，该指针应该指向主叫端生成的sdp。3.2.2 max_retransmit_time与max_retransmitsmax_retransmit_time与max_retransmits至少有一个参数值为-1，否则RTCSDK将max_retransmit_time设为-1。3.3 RTCSDK接口class RTCSDK { 
public: 
virtual void CreatePeer(const RTCParam param) = 0; 
virtual void SetRemoteDescription
         (const char* peer_id, const char* sdp) = 0; 
virtual void DestroyPeer(const char* peer_id = nullptr) = 0; 
virtual bool SendData
         (const char* peer_id, unsigned char *data, size_t size) = 0; 
virtual void TurnVideoOff() = 0;
virtual void EnableVideoSource(bool is_enable) = 0; 
virtual void EnableMicPhone(bool is_enable) = 0; 
};
3.3.1 CreatePeer与SetRemoteDescription详见2.1节。3.3.2 DestroyPeer不传参数，释放所有资源。
传入peer_id，释放与该peer_id相关的资源。当只有一个peer_id时，释放所有资源。3.3.3 SendData发送数据。其中peer_id为对端的id；data为要发送的数据；size为发送数据的大小。3.3.4 TurnVideoOff在多人音视频中，将视频会话转换为音频会话，此过程不可逆。3.3.5 EnableVideoSource打开关闭本地视频的显示与发送，此过程可逆。3.3.6 EnableMicPhone打开关闭话筒。3.4 回调接口class RTCCallBack { 
public: 
virtual void onRTCSDKMessage
         (const char* peer_id, const int type, 
             const char* msg, const int data_size) = 0; 
};
3.4.1 peer_id对方的id。3.4.2 type回调类型，详见3.5节3.4.3 msg回调数据，当type为kOffer时，msg为主叫生成的sdp；当type为kAnswer时，msg为被叫生成的sdp；当type为kData时，msg为接收到的数据。3.4.4 data_size仅当type为kData时，data_size为接收到数据的大小，单位为字节，其余情况下为-1。3.5 回调状态enum RTCSDKMsgType{
kOffer = 101, // 主叫回调sdp 
kAnswer = 102, // 被叫回调sdp
kIceConnected = 103, // 连接成功 
kIceDisconnected = 104, // 连接断开 
kIceConnectionFailed = 105, // 连接失败 
kData = 107, // 接收到数据 
kNoCamera = 201 // 没有摄像头 
};

AVSDK/RTCSDK_Android.html.body:
RTCSDK(Android)2017-04-271. RTCSDK简介RTCSDK提供一对一和多对多的音视频会话与数据发送接收功能。如图1所示，图1(a)中展示的是A与B两点之间的音视频会话，图1(b)中展示的是A、B和C三点的音视频会话。图1.RTCSDK的音视频会话功能
2.RTCSDK音视频会话的建立2.1 两点
A与B两点之间音视频会话的建立如图2所示。其中A是主叫，B是被叫。图2 两点音视频会话的建立
步骤：
1.主叫A调用RTCSDK接口CreatePeer，传入参数RTCParam，其中参数PeerID为被叫B的ID，参数sdp为NULL。（详见3.2RTCSDK参数）
2.RTCSDK回调接口onRTCSDKMessage，其中PeerID为被叫B的ID，消    息类型type为MSG_CALLBACK_SDP_OFFER，消息msg为生成的sdp。
3.4. 将sdp传递至被叫。
5.被叫调用RTCSDK接口CreatePeer，传入参数RTCParam，其中参数PeerID为主叫A的ID，参数sdp为A生成的sdp。
6.RTCSDK回调接口onRTCSDKMessage，其中PeerID为被叫A的ID，消息类型typ为MSG_CALLBACK_SDP_ANSWER，消息msg为生成的sdp。
7.8. 将sdp传递至主叫。
9 主叫调用RTCSDK接口  setRemoteDescription，其中参数PeerID为被叫B的ID，参数sdp为B生成的sdp。
10    音视频连通，主叫和被叫的RTCSDK会通过接口onRTCSDKMessage回调MSG_ICE_CONNECTION。2.2 多点多点音视频会话的建立与两点类似。以三点的音视频会话为例，如图1(b)所示，C在A与B已经建立完成音视频会话的基础上，再分别与A和B进行两点间的音视频会话的建立。3.RTCSDK接口3.1 创建与销毁RTCSDK3.1.1 创建void createPeer(RTCParam param)3.1.2 销毁void destroyPeer(String peerID)3.2 RTCSDK参数public class RTCParam {
    private String peerId;   //多点，区分peerConnection
    private String sdp = "";         //sdp
    private Activity activity;//显示音视频的界面
    private SurfaceViewRenderer localRender;
    private SurfaceViewRenderer remoteRender;
    private UserCallBack userListener; //回调监听
    private String iceServer;//ip和端口合成一个
    private String iceRelayServer;//中转 预留
    private String iceRelayPort;  //中转 预留
    private String iceUser; //ice用户登录名
    private String icePwd;//ice用户登录密码
    private int videoMaxBitrate; //最大码率
    private int videoStartBitrate;//开始码率
    private boolean isOpenVideo;//是否为视频
};
3.2.1 sdp主叫端在进行CreatePeer时，为""。被叫端在进行CreatePeer时，为主叫端生成的sdp。
3.3 RTCSDK接口Class RTCSDK{
 void createPeer(RTCParam param)；
 void setRemoteDescription(String peerID, String sdp)
 void destroyPeer(String peerID)；
 void enableMicPhone(boolean isAudioEnableMicPhone)
 void enableSpeaker(boolean isAudioEnableSpeaker)
 void switchCamera()
 void enableVideoSource(boolean enableVideoSource)
 void turnVideoOff()
}
3.3.1 createPeer与setRemoteDescription详见2.1节。3.3.2 destroyPeer参数为空，释放所有资源。
传入peerID，释放与该peerID相关的资源。当只有一个peerID时，释放所有资源。3.3.3 enableSpeaker打开/关闭外放3.3.4 turnVideoOff在多人音视频中，将视频会话转换为音频会话，此过程不可逆。3.3.5 enableVideoSource打开关闭本地视频的显示与发送，此过程可逆。3.3.6 enableMicPhone打开/关闭话筒3.4 回调接口public interface UserCallBack {
    public static final int MSG_CALLBACK_SDP_ANSWER = 101;
   //呼叫或者接听后返回的字符  被叫
    public static final int MSG_CALLBACK_SDP_OFFER = 102; 
   //呼叫或者接听后返回的字符 主叫
    public static final int MSG_ICE_CONNECTION = 103; 
   //数据联通
    public static final int MSG_ICE_DISCONNECTION = 104;
   //数据断开
    public static final int MSG_ICE_FAILES = 105; 
    //数据链接失败（资源释放最好在该状态中）
    public static final int MSG_PEERCONNECTION_ERROR = 106;
   //呼叫数据出错
    /**
     * avsdk回调接口
     *
     * @param peerId peerID
     * @param type   消息类型
     * @param msg    返回的消息
     */
    void onRTCSDKMessage(String peerId, int type, String msg);
}
3.4.1 peerId对方的id3.4.2 type回调类型，详见常量定义节3.4.3 msg回调数据，当type为MSG_CALLBACK_SDP_OFFER时，msg为主叫生成的sdp；当type为MSG_CALLBACK_SDP_ANSWER时，msg为被叫生成的sdp；
